TextFile OpenA(SDL_Charstring FName)
{
  FILE *temp;
  char *fn;

  if(!FName) return NULL;
  fn = FName+1;
  if(!strcmp(fn,"stdout"))
    temp = stdout;
  else if(!strcmp(fn,"stderr"))
    temp = stderr;
  else temp = fopen(fn, "a");
#ifdef XREADANDWRITEF
  isAssign = 1;
  if(!temp) return NULL;
  if(! (temp == stdout || temp == stdin || temp == stderr)){
    NameOfFile[++NFiles] = (char *)malloc(strlen(fn)+1);
    strcpy(NameOfFile[NFiles], fn);
    FilePtr[NFiles] = temp;
  }
#endif
  if (FName[0] == 'T')
    xFree_SDL_Charstring((void **)&FName);
  return temp;
}

TextFile CloseF(TextFile F)
{
  int i = 0;
  if (F != TextFileNull() && F != stdin && F != stdout && F != stderr) {
#ifdef XREADANDWRITEF
    isAssign = 1;
    while(i<NFiles && FilePtr[i]!= F)i++;
    if (i<FOPEN_MAX) {
      free (NameOfFile[i]);
      FilePtr[i] = NULL;
      NameOfFile[i] = NULL;
      NFiles --;
    }
#endif
    fclose(F);
  }
  return TextFileNull();
}

